package com.device.dto;

public class DeviceDto {
	private Integer idRoomList;
	private String roomId;
	private String roomNum;
	private String soltNum;
	private String floor;
	private Integer hotelId;
	private Integer idSoltList;
	private Integer subNetNum;
	private Integer agentId;

	public DeviceDto() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Integer getIdRoomList() {
		return idRoomList;
	}

	public void setIdRoomList(Integer idRoomList) {
		this.idRoomList = idRoomList;
	}

	public String getRoomId() {
		return roomId;
	}

	public void setRoomId(String roomId) {
		this.roomId = roomId;
	}

	public String getRoomNum() {
		return roomNum;
	}

	public void setRoomNum(String roomNum) {
		this.roomNum = roomNum;
	}

	public String getSoltNum() {
		return soltNum;
	}

	public void setSoltNum(String soltNum) {
		this.soltNum = soltNum;
	}

	public String getFloor() {
		return floor;
	}

	public void setFloor(String floor) {
		this.floor = floor;
	}

	public Integer getHotelId() {
		return hotelId;
	}

	public void setHotelId(Integer hotelId) {
		this.hotelId = hotelId;
	}

	public Integer getIdSoltList() {
		return idSoltList;
	}

	public void setIdSoltList(Integer idSoltList) {
		this.idSoltList = idSoltList;
	}

	public Integer getAgentId() {
		return agentId;
	}

	public void setAgentId(Integer agentId) {
		this.agentId = agentId;
	}

	public Integer getSubNetNum() {
		return subNetNum;
	}

	public void setSubNetNum(Integer subNetNum) {
		this.subNetNum = subNetNum;
	}

}
